import React from 'react';
import './ChemistryWorkspace.css';

const ChemistryWorkspace = ({ apparatusList }) => {
  return (
    <div className="chemistry-workspace">
      {apparatusList.map((apparatus, index) => (
        <div key={index} className="workspace-item">
          <img src={apparatus.imageSrc} alt={apparatus.name} />
          <span>{apparatus.name}</span>
        </div>
      ))}
    </div>
  );
};

export default ChemistryWorkspace;
